import {
  SlCarouselItem
} from "./chunk.ZSQZTC74.js";

// src/react/carousel-item/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-carousel-item";
SlCarouselItem.define("sl-carousel-item");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlCarouselItem,
  react: React,
  events: {},
  displayName: "SlCarouselItem"
});
var carousel_item_default = reactWrapper;

export {
  carousel_item_default
};
